package com.yaowang.lansha.entity;import java.io.Serializable;import java.util.Date;/** * 微信JS接口访问的票据  * @author  *  */public class WechatJsapiticket implements Serializable{	private static final long serialVersionUID = 1L;		/**	 * id	 */	private String id;	/**	 * 应用id	 */	private String appId;	/**	 * ticket名	 */	private String ticketName;	/**	 * 发布时间	 */	private Date pubDate;	/**	 * 失效时间(秒)	 */	private Integer expiresIn;	/**	 * create_time	 */	private Date createTime;		/**	 * 设置id	 */	 public void setId(String id){	 	this.id = id;	 }	 	 /**	  * 获取id	  */	 public String getId(){	 	return this.id;	 }	/**	 * 设置应用id	 */	 public void setAppId(String appId){	 	this.appId = appId;	 }	 	 /**	  * 获取应用id	  */	 public String getAppId(){	 	return this.appId;	 }	/**	 * 设置ticket名	 */	 public void setTicketName(String ticketName){	 	this.ticketName = ticketName;	 }	 	 /**	  * 获取ticket名	  */	 public String getTicketName(){	 	return this.ticketName;	 }	/**	 * 设置发布时间	 */	 public void setPubDate(Date pubDate){	 	this.pubDate = pubDate;	 }	 	 /**	  * 获取发布时间	  */	 public Date getPubDate(){	 	return this.pubDate;	 }	/**	 * 设置失效时间(秒)	 */	 public void setExpiresIn(Integer expiresIn){	 	this.expiresIn = expiresIn;	 }	 	 /**	  * 获取失效时间(秒)	  */	 public Integer getExpiresIn(){	 	return this.expiresIn;	 }	/**	 * 设置create_time	 */	 public void setCreateTime(Date createTime){	 	this.createTime = createTime;	 }	 	 /**	  * 获取create_time	  */	 public Date getCreateTime(){	 	return this.createTime;	 }}